import React from 'react';
import ReactDOM from 'react-dom';
import { SocialIcon } from 'react-social-icons';


const PersonalSocial = () => {
    return (
    <div>
     <p>
     <SocialIcon url="https://twitter.com/lu_calm" />
     <SocialIcon url="https://www.youtube.com/channel/UC9GTIw90lZei5mUfjmTf7fg" />
     <SocialIcon url="https://github.com/lu-calm" />

      </p>

    </div>
  )
}


export default PersonalSocial;



ReactDOM.render(<SocialIcon url="https://twitter.com/jaketrent" />, document.body);
